DROP TABLE IF EXISTS public.airports_codes;

CREATE TABLE IF NOT EXISTS "public"."authors" (
  "id"   SERIAL,
  "ident" TEXT,
  "type" TEXT,
  "name" TEXT,
  "latitude_deg" TEXT,
  "longitude_deg" TEXT,
  "iso_country" TEXT,
  "iso_region" TEXT,
  "municipality" TEXT,
  "gps_code" TEXT,
  "iata_code" TEXT,
  "local_code" TEXT,
  PRIMARY KEY ("id")
);

